schema:
{
 "description": "Model is the Schema for the Models API",
 "properties": {
  "spec": {
   "description": "ModelSpec defines the desired state of Model.\n\n\nThe properties of a model as returned by the Search API.",
   "properties": {
    "containers": {
     "description": "Specifies the containers in the inference pipeline.",
     "items": {
      "description": "Describes the container, as part of model definition.",
      "properties": {
       "containerHostname": {
        "type": "string"
       },
       "environment": {
        "additionalProperties": {
         "type": "string"
        },
        "type": "object"
       },
       "image": {
        "type": "string"
       },
       "imageConfig": {
        "description": "Specifies whether the model container is in Amazon ECR or a private Docker\nregistry accessible from your Amazon Virtual Private Cloud (VPC).",
        "properties": {
         "repositoryAccessMode": {
          "type": "string"
         },
         "repositoryAuthConfig": {
          "description": "Specifies an authentication configuration for the private docker registry\nwhere your model image is hosted. Specify a value for this property only\nif you specified Vpc as the value for the RepositoryAccessMode field of the\nImageConfig object that you passed to a call to CreateModel and the private\nDocker registry where the model image is hosted requires authentication.",
          "properties": {
           "repositoryCredentialsProviderARN": {
            "type": "string"
           }
          },
          "type": "object"
         }
        },
        "type": "object"
       },
       "inferenceSpecificationName": {
        "type": "string"
       },
       "mode": {
        "type": "string"
       },
       "modelDataURL": {
        "type": "string"
       },
       "modelPackageName": {
        "type": "string"
       },
       "multiModelConfig": {
        "description": "Specifies additional configuration for hosting multi-model endpoints.",
        "properties": {
         "modelCacheSetting": {
          "type": "string"
         }
        },
        "type": "object"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "enableNetworkIsolation": {
     "description": "Isolates the model container. No inbound or outbound network calls can be\nmade to or from the model container.",
     "type": "boolean"
    },
    "executionRoleARN": {
     "description": "The Amazon Resource Name (ARN) of the IAM role that SageMaker can assume\nto access model artifacts and docker image for deployment on ML compute instances\nor for batch transform jobs. Deploying on ML compute instances is part of\nmodel hosting. For more information, see SageMaker Roles (https://docs.aws.amazon.com/sagemaker/latest/dg/sagemaker-roles.html).\n\n\nTo be able to pass this role to SageMaker, the caller of this API must have\nthe iam:PassRole permission.",
     "type": "string"
    },
    "inferenceExecutionConfig": {
     "description": "Specifies details of how containers in a multi-container endpoint are called.",
     "properties": {
      "mode": {
       "type": "string"
      }
     },
     "type": "object"
    },
    "modelName": {
     "description": "The name of the new model.",
     "type": "string"
    },
    "primaryContainer": {
     "description": "The location of the primary docker image containing inference code, associated\nartifacts, and custom environment map that the inference code uses when the\nmodel is deployed for predictions.",
     "properties": {
      "containerHostname": {
       "type": "string"
      },
      "environment": {
       "additionalProperties": {
        "type": "string"
       },
       "type": "object"
      },
      "image": {
       "type": "string"
      },
      "imageConfig": {
       "description": "Specifies whether the model container is in Amazon ECR or a private Docker\nregistry accessible from your Amazon Virtual Private Cloud (VPC).",
       "properties": {
        "repositoryAccessMode": {
         "type": "string"
        },
        "repositoryAuthConfig": {
         "description": "Specifies an authentication configuration for the private docker registry\nwhere your model image is hosted. Specify a value for this property only\nif you specified Vpc as the value for the RepositoryAccessMode field of the\nImageConfig object that you passed to a call to CreateModel and the private\nDocker registry where the model image is hosted requires authentication.",
         "properties": {
          "repositoryCredentialsProviderARN": {
           "type": "string"
          }
         },
         "type": "object"
        }
       },
       "type": "object"
      },
      "inferenceSpecificationName": {
       "type": "string"
      },
      "mode": {
       "type": "string"
      },
      "modelDataURL": {
       "type": "string"
      },
      "modelPackageName": {
       "type": "string"
      },
      "multiModelConfig": {
       "description": "Specifies additional configuration for hosting multi-model endpoints.",
       "properties": {
        "modelCacheSetting": {
         "type": "string"
        }
       },
       "type": "object"
      }
     },
     "type": "object"
    },
    "tags": {
     "description": "An array of key-value pairs. You can use tags to categorize your Amazon Web\nServices resources in different ways, for example, by purpose, owner, or\nenvironment. For more information, see Tagging Amazon Web Services Resources\n(https://docs.aws.amazon.com/general/latest/gr/aws_tagging.html).",
     "items": {
      "description": "A tag object that consists of a key and an optional value, used to manage\nmetadata for SageMaker Amazon Web Services resources.\n\n\nYou can add tags to notebook instances, training jobs, hyperparameter tuning\njobs, batch transform jobs, models, labeling jobs, work teams, endpoint configurations,\nand endpoints. For more information on adding tags to SageMaker resources,\nsee AddTags.\n\n\nFor more information on adding metadata to your Amazon Web Services resources\nwith tagging, see Tagging Amazon Web Services resources (https://docs.aws.amazon.com/general/latest/gr/aws_tagging.html).\nFor advice on best practices for managing Amazon Web Services resources with\ntagging, see Tagging Best Practices: Implement an Effective Amazon Web Services\nResource Tagging Strategy (https://d1.awsstatic.com/whitepapers/aws-tagging-best-practices.pdf).",
      "properties": {
       "key": {
        "type": "string"
       },
       "value": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "vpcConfig": {
     "description": "A VpcConfig object that specifies the VPC that you want your model to connect\nto. Control access to and from your model container by configuring the VPC.\nVpcConfig is used in hosting services and in batch transform. For more information,\nsee Protect Endpoints by Using an Amazon Virtual Private Cloud (https://docs.aws.amazon.com/sagemaker/latest/dg/host-vpc.html)\nand Protect Data in Batch Transform Jobs by Using an Amazon Virtual Private\nCloud (https://docs.aws.amazon.com/sagemaker/latest/dg/batch-vpc.html).",
     "properties": {
      "securityGroupIDs": {
       "items": {
        "type": "string"
       },
       "type": "array"
      },
      "subnets": {
       "items": {
        "type": "string"
       },
       "type": "array"
      }
     },
     "type": "object"
    }
   },
   "required": [
    "executionRoleARN",
    "modelName"
   ],
   "type": "object"
  }
 },
 "title": "Model",
 "type": "object"
}
